package p01Control;

public class C06For {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println(1);
		
		
	
		for(int i=0;i<2;i++) {
			System.out.println(2);
			System.out.println(3);
		}
		
		System.out.println(4);
		
		for(int i=0;i<4;i++) {
			System.out.println(i+1);
		}
	}

}
